import React, { useState } from "react";
import { Link } from "react-router-dom";
import { ReactComponent as SvgA } from './Asysmbol.svg';

var color = {
    color: "var(--secondary-color)"
}

function setColor(name) {
    if (window.location.pathname == ("/" + props.name)) {
        color = { color: "var(--secondary-color)" }
    }
    else {
        color = { color: "white" }
    }
}

function SideIcons(props) {

    var name = props.name;
    if (props.type == "text") {
        return (
            <li className="navbar-item">
                <Link to={"/" + props.name}>
                    <a className="side-icons-text" style={color} onClick={setColor()} >
                        {props.name}
                    </a>
                </Link>

            </li >
        );
    }
    else if (props.type === "head") {
        return (
            <Link to={"/"}>
                <SvgA className="navLogo" />
            </Link>

        );
    }
}

export default SideIcons;
